@lesleyannemurphy and I are finally doing it! We're finally planning an epic adventure this winter. #ad How has it taken this long!? We've both been traveling the world, watching one another's adventures from afar. Currently, I've been backpacking in Utah, while Lesley has been exploring the South Pacific - but we have yet to travel together again.

And, since we both have the @BankofAmerica Travel Rewards Visa¬Æ credit card, we decided to redeem our points toward this trip after we get home. The @BankofAmerica Travel Rewards Visa¬Æ credit card offers 1.5 points per $1 on all purchases and I earn even more because I'm a Preferred Rewards member, soo .. we have a friendly competition going to see who can earn the most points. (I think I have this one in the bag since I've already started my holiday shopping). I first met @lesleyannemurphy 7 years ago as I was stepping out of a limo ride that would forever change my life - she was the small town girl who had explored the world, carried a football while wearing a ballgown, and made me feel like the whole "journey" ahead of us wasn't going to be so frightening after all. For the next several weeks we traveled the country, dated the same guy (weird), and shared experiences that can only be described as "one of a kind." Excited for this adventure together!

But now the big question remains ... Where should we go?! Leave us your suggestions in the comments - we're looking for adventure, hiking, camping, glamping, and lots of exploring here in the U.S. We'll announce where we decide in our stories this week. Check out the link in my bio to learn more!

