It had been a dream of mine to see the lupins in full bloom again. I remembered seeing patches on the side of the road as a child during family road trips to Central Otago, but we never stopped. They‚Äôre just a weed my parents would tell me, which I now know to be true. As pretty as they are and as amazing as they smell, they were introduced to New Zealand and are actually harmful to some native plants and bird life whose habitats they have overrun. With that said, they are still a photographers dream, and with active attempts to control them, they may one day soon be gone. 
Here‚Äôs @joellefriend frolicking amongst this beautiful weed, staying warm on a chilly New Zealand spring evening wearing the @eddiebauer ladder creek high-pile parka! We couldn‚Äôt believe how many different colors there were! Swipe to check them all out! üå∏#LiveYourAdventure #EBContributor

@eddiebauer also happens to have an amazing Parka sale going on right now for anyone who wants to snag one! Link in my bio :)

